import React, { Fragment } from 'react';

const About = () => {
  return (
    <Fragment>
      <h1>About This App</h1>
      <p>This App was developed to search Github Users.</p>
      <p>By Robert Elias</p>
    </Fragment>
  );
};

export default About;
